IF OBJECT_ID('dbo.proc_transform_236', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_236;
GO
CREATE PROCEDURE dbo.proc_transform_236
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_236
    SET payload = LEFT(payload, 1000) + N'|V4-236|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_236;
END
